    }

    public class HtmlService
    {
        public static string ParsingHtmlForm(HttpBuilderModel model)
        {
            var from = string.Empty;
            string display;
            if (model.From.Contains("dheader"))
            {
                from = @"<div class=""dheader""";
                display = "dHeader";
            }
            else if (model.From.Contains("generalForm"))
            {
                from = @"<form name=""generalForm""";
                display = "generalForm";
            }
            else
            {
                from = model.From;
                display = "form";
            }
            var codeBuilder = new StringBuilder();
            codeBuilder.AppendFormat(@"var {0}Form = {1}.Substring({2}, endForm);", model.NameOfCollection,
                model.PageVariable, display);
            codeBuilder.AppendLine();
            codeBuilder.AppendFormat(@"var {0}Collection = GetHiddenFormCollection({0}Form);", model.NameOfCollection);
            codeBuilder.AppendLine();
            var formHtml = model.SourceValue.Substring(from, "</form>");
            var differences = ReadingForm(formHtml, model.Parameter);
            foreach (var item in differences)
            {
                codeBuilder.AppendFormat(@"{0}Collection[""{1}""] = ""{2}"";", model.NameOfCollection, item.Name, item.Value);
                codeBuilder.AppendLine();
            }
            codeBuilder.AppendFormat(@"using (
                var rsp =
                    _client.PostAsync(MainPageUri, HttpUtils.CreateFormEncodedData({0}Collection)).Result)",
                model.NameOfCollection);
            codeBuilder.AppendLine();
            codeBuilder.Append("{ ");
            codeBuilder.AppendFormat("var page = rsp.Content.ReadAsStringAsync().Result;");
            codeBuilder.Append(" }");
            codeBuilder.AppendLine();
            var result2 = codeBuilder.ToString();
            return result2;
        }

        private static List<NameValue> ReadingForm(string formHtml, string parameter)
        {
            var doc = new HtmlDocument();
            doc.LoadHtml(formHtml);
            var list = new List<NameValue>();
            foreach (var input in doc.DocumentNode.Descendants(@"//input[@type=""hidden""]"))
            {
                if (input.Attributes["value"] == null)
                {
                    list.Add(new NameValue
                    {
                        Name = input.Attributes["name"].Value,
                        Value = ""
                    });
                }
                else
                {
                    list.Add(new NameValue
                    {
                        Name = WebUtility.HtmlDecode(input.Attributes["name"].Value),
                        Value = input.Attributes["value"].Value
                    });
                }
            }
            var list2 = NameRequest(parameter);
            var difference = (from item in list2
                              let valid =
                                  list.Where(item1 => item.Name.Equals(item1.Name)).Any(item1 => item.Value.Equals(item1.Value))
                              where !valid
                              select new NameValue
                              {
                                  Name = item.Name,
                                  Value = item.Value
                              }).ToList();
            return difference;
        }

        private static List<NameValue> NameRequest(string parameter)
        {
            return (from line in parameter.Split(new[] { "\r\n" }, StringSplitOptions.RemoveEmptyEntries)
                    let seperatorIndex = line.IndexOf("\t", StringComparison.Ordinal)
                    select new NameValue
                    {
                        Name = WebUtility.HtmlDecode(line.Substring(0, seperatorIndex)),
                        Value = line.Substring(seperatorIndex + 1, line.Length - seperatorIndex - 1).Trim()
                    }).ToList();
        }

