            sb.Append(GetHtmlHeaderWithStyle);
            sb.Append("<body>");
            sb.AppendLine();
            sb.Append(@"<div class=""tree"">");
            sb.Append(@"<ul>");

            foreach (XElement el in address)
            {
                sb.Append("<li>");
                var firstElementValue = el.Element("province_id").Value;
                var province = el.Element(firstElementValue).Elements(firstElementValue + "_bankinfo");
                sb.AppendFormat(@"<span><i class=""icon-folder-open""></i>{0} {1}</span>", firstElementValue, el.Element("province_name").Value);
                sb.Append("<ul>");
                foreach (var item in province)
                {
                    sb.Append("<li>");
                    sb.AppendFormat(@"<span><i class=""icon-minus-sign""></i>{0} {1}</span>", item.Element("bank_id").Value, item.Element("bank_name").Value);
                    sb.Append(@"</li>");
                }
                sb.Append("</ul>");
                sb.Append(@"</li>");
            }
            sb.Append(@"</ul>
</div>
</body>
</html>");
            return sb.ToString();
        }

